$(document).ready(function() {
  $('.filter-table').closest('.ibox-content').find('input').keypress(function(e) {
    var keyCode = e.which ? e.which : e.keyCode
    if(keyCode == 13)
      $(this).closest('.ibox-content').find('button.search').click();
  });
});
